// Dashboard.js

import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';

function Dashboard() {
  const username = localStorage.getItem('username');
  const [budgetData, setBudgetData] = useState(null);

  useEffect(() => {
    // Fetch user-related budget data from your API
    fetch(`/api/budget/${username}`)
      .then((response) => response.json())
      .then((data) => setBudgetData(data))
      .catch((error) => console.error('Error fetching budget data:', error));
  }, [username]);

  return (
    <div className="dashboard">
      <section className="dash-head">
        <h1 className="dashboard-head">{username}'s Dashboard</h1>
        <Link to="/login" className="logout-link">
          Logout
        </Link>
      </section>
      <section className="welcome-section">
        <p>Welcome {username}</p>
        {budgetData && (
          <div>
            <h2>Your Budget Information</h2>
            {/* Render budget data here */}
            <pre>{JSON.stringify(budgetData, null, 2)}</pre>
          </div>
        )}
      </section>
    </div>
  );
}

export default Dashboard;
